// index.js
import React from "react";
import ReactDOM from "react-dom";
import AirPollution from "./indvArticles/airpollution";

const myArticles = [AirPollution];

function App() {
	return (
		<div>
			{myArticles.map((myArticles, index) => (
				<div key={index} style={{ margin: "20px", padding: "20px", border: "1px solid black" }}>
					<h1>{myArticles.title}</h1>
					<p>{myArticles.description}</p>
					<style>{myArticles.style}</style>
					{myArticles.body}
				</div>
			))}
		</div>
	);
}

ReactDOM.render(<App />, document.getElementById("root"));
